import React from "react";
import { Route, Switch } from 'react-router-dom';
import Footer from "../Footer/Footer";
import Header from "../Header/Header";
import Main from "../Main/Main";


function App() {
  return (
    <div className="page">
      <Switch>
        <Route path="/">
          <Header />
          <Main />
        </Route>
        <Route path="/">
          <Header />
        </Route>
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
